import React from 'react'

import {
  ButtonHome,
  ButtonUser,
  ButtonTeam,
  ContainerTab,
  TabBar,
} from '../../styles/components/Navigation'

export const Navigation = () => {
  return (
    <ContainerTab>
      <TabBar></TabBar>
      <ButtonTeam />
      <ButtonHome />
      <ButtonUser />
    </ContainerTab>
  )
}
